ADOBE FIREWORKS CS5 TRAINING DVD FOR WINDOWS &amp; MAC (Exercise files included)      

Total Training for Fireworks CS5 begins by teaching you the foundations of 
Fireworks and will quickly show you how to create vector shapes and design a logo. 
You will also learn to work with text, bitmaps and layers before moving onto 
creating interactive buttons using slices, hot spots and rollovers.
Finally, you will explore wireframing, RIA, AIR and mobile prototyping and how 
Fireworks allows you to design in multiple pages and even export standards 
compliant CSS.

